import Avatar from "@mui/material/Avatar";

const ChartBoy = () => {
  return (
    <div>
      <h2>남자아이돌 차트</h2>
      <div id="chart-container">
        <div>
          <Avatar src="../assets/NCT_제노.PNG" />
        </div>
      </div>
    </div>
  );
};

export default ChartBoy;
